import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import PlayerList from "./Components/PlayerList";

class App extends Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div className="App">
        <h1>Hello world!!</h1>
        <PlayerList />
      </div>
    );
  }
}

export default App;
